import React from 'react';
import './index.css';

export default function Footer() {
    return (
        <div id="footer" className="mt-5">
            <div className="footerStripe" style={{ backgroundColor: "#F14F4F" }}></div>
            <div className="footerStripe" style={{ backgroundColor: "#F1D74F" }}></div>
            <div className="footerStripe" style={{ backgroundColor: "#84D7AF" }}></div>
            <div className="githubSprite sprite d-inline-block m-2"></div>
            <div className="linkedInSprite sprite d-inline-block m-2"></div>
            <div className="emailSprite sprite d-inline-block m-2"></div>
            <div className="d-inline-block float-end text-end m-2"><a href="#">back to top ↑</a></div>
            <p className="text-center">designed and made with ♥ by Sara Alvarado<br></br>
            built with react</p>
        </div>
    );
}
